import React from 'react'
import styled from 'styled-components';
import './page.css';
import logo1 from './../img/logo2.png';
const Container = styled.div`
    height: 60px;
`
const Wrapper = styled.div`

 display:flex;
 
`
const Home =styled.div`
font-family: sans-serif;
font-size:12px;
 color:#151515;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
`
const About = styled.div`

font-family: sans-serif;
font-size:12px;
 color:#151515;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
`
const List = styled.div`

font-family: sans-serif;
font-size:12px;
 color:#151515;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
`
const Logo = styled.div`
width:400px;
`
const Search = styled.div`
border: 0.5px solid #151515;
display:flex;
width: 250px;
height:25px;
margin-top: 30px;
margin-left:60px;


`


const Navbar = () => {
    return (
       <Container>
           <Wrapper>
              <Home className='Home'>
                  TRANG CHỦ
              </Home>
              <About className='About'>
                  GIỚI THIỆU
              </About>
              <List className='List'>
                  DANH SÁCH 
              </List>
              <Logo className='Logo'>
              <img src={logo1}></img>
              </Logo>
              <Search>
                <input className='input' placeholder='TÌM KIẾM'></input>
                <i class="fas fa-search"></i>
              </Search>
              
           </Wrapper>
       </Container>
    )
}





export default Navbar
